script: |
  super -f text -I q10925.spq | sort > q10925.out

inputs:
  - name: q10925.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE - col0 + col1 * + col0 NOT BETWEEN col2 + col2 * col0 AND ( + col2 * - tab0.col0 );
  - name: tab0

outputs:
  - name: q10925.out
    data: |
      24	86	33
      35	97	1
      89	91	82
